service:
  namespace: edelevery-sdn

  ingress:
    enabled: false
    annotations:
      kubernetes.io/ingress.class: nginx
    hosts:
      - host: ap-dds.nsptest.medcom.dk
        paths:
          - path: /domibus
    tls:
      - hosts:
          - ap-dds.nsptest.medcom.dk
        secretName: ap-dds.nsptest.medcom.dk

  image:
    repository: dockerregistry.t0.hosting.kitkube.dk/edelivery/ap_ws

  initContainers:
    keystorebuilder:
      image:
        repository: dockerregistry.t0.hosting.kitkube.dk/dockerhub/library/openjdk
      resources:
        limits:
          cpu: 250m
          memory: 512Mi
        requests:
          cpu: 50m
          memory: 64Mi

          
  deployment:
    resources:
      limits:
        cpu: 250m
        memory: 2Gi
      requests:
        cpu: 150m
        memory: 1Gi

  certificate:

  sealedSecret:
    ap-dds:
      encryptedData:
        tls.crt: 
        tls.key: 
      type: kubernetes.io/tls

    star.edelivery.dsdn.dk:
      encryptedData:
        tls.crt: 
        tls.key: 
      type: kubernetes.io/tls
